//import logo from './logo.svg';
import './App.css';
import Table from './components/Table'
import welcome from './components/welcome';

function App() {
  let name="John";
  return (
    <div className="App">
     <h1>Hello world</h1>
     <Table/>
     <welcome name={name} age={10}/>
    </div>
  );
}

export default App;
